import React from 'react'

import Header from './Header'
import { Panel, Paragraph } from 'rsuite'

export default function Home() {
    return (
        <div>
            <Header />
            <Panel header="Panel title" shaded>
                <Paragraph />
            </Panel>
        </div>
    )
}
